Ad Text:
We’re partnering with a national managed services provider who are growing their engineering team and looking to bring on experienced Level 2 and Level 3 Engineers. 
 
These are hands-on, client-facing roles where you’ll take ownership of issues end-to-end, act as a trusted technical advisor to customers, and work across both BAU support and project delivery. You’ll support a range of client environments remotely and on-site, manage escalations, and mentor junior engineers where required. 
 
What you’ll be doing 

Providing advanced Level 2 and 3 technical support across multiple client environments;
Acting as an escalation point for Level 1/2 engineers;
Troubleshooting complex infrastructure, application and network issues;
Owning key customer environments and providing specialist support;
Contributing to IT projects including design and implementation;
Liaising with vendors, suppliers and third-party support providers;
Supporting asset management and technology roll-outs; and
Building and maintaining strong client relationships.
What we’re looking for 

Proven experience in a managed services / MSP environment;
Strong Microsoft stack experience (Windows, M365, Azure, AD, Exchange);
Solid server, networking and troubleshooting capability;
Experience working directly with clients and managing expectations;
Ability to work independently while contributing to a team environment; and 
Clear communication skills and a customer-first mindset.
Why this role 

Exposure to a wide variety of technologies and client environments;
Mix of support and project work, not just ticket queues;
Clear progression for engineers looking to step into senior or lead roles; and
Supportive, collaborative MSP culture.
How to Apply 
 
For more information or a confidential discussion please call Mariam Iskandar at u&u on 02 8245 7900 quoting reference number 44115.
 
At u&u Recruitment Partners, we value diversity, equity and inclusion. We welcome applications from Aboriginal and Torres Strait Islander people, people with diverse cultural and linguistic backgrounds and people with disability. 
 
Should you require reasonable adjustments throughout the recruitment process, we encourage you to make a request via adjustments@uandu.com or phone the above-mentioned u&u consultant to discuss. In response to these requests, we will collaborate closely with you to implement the appropriate adjustments. 
 
Additionally, for a barrier-free and inclusive online experience, you can access u&u’s opportunities using accessibility software Recite Me at https://www.uandu.com/jobs.  
 
Please submit your resume in Word format only.
